import React, { Component } from "react";
import { authContext } from "../adal/config";
import { Navbar, NavbarBrand } from "react-bootstrap";

class NavigationBar extends Component {
  handleLogout = () => {
    authContext.logOut();
  };

  render() {
    return (
      <NavBar>
        <Navbar.Header />
      </NavBar>
    );
  }
}
export default NavigationBar;
